import './App.css';
import Profile from './api/profile'
import {
  BrowserRouter,
  Routes,
  Route} from "react-router-dom";
import Login from './components/login';
function App() {
  return (
    <div className="App">
      <h1>Gossip</h1>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Login />} />

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
